  return (
    <div className="App">
      <Header />
        <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          <code><HelloWorld /></code>
        </p>
        <Counter />
        <Alert />
        </header>
    </div>
  );
}

export default App;
